import React from 'react';
import PropTypes from 'prop-types';

//app
import { Layout } from 'components';
import { LinkClaimSelectPolicy,RegisterNewLossFixedBottomBar } from 'modules';
import styles from './LinkSearchPolicy.styles';

//mui
import { makeStyles, Grid, Box } from '@material-ui/core';

LinkSearchPolicyView.propTypes = {
  isAllStepsCompleted: PropTypes.bool.isRequired,
  lastStep: PropTypes.bool.isRequired,
  handleCancel: PropTypes.func.isRequired,
  handleFinish: PropTypes.func.isRequired,
  handleNext: PropTypes.func.isRequired,
  handleBack: PropTypes.func.isRequired,
  handleNextSubmit: PropTypes.func,
  hasPolicyRef: PropTypes.bool.isRequired,
  policyInformation: PropTypes.object.isRequired,
  setCurrentContextActive: PropTypes.func,
  currentContextActive: PropTypes.bool,
};

export default function LinkSearchPolicyView(props) {
  const {
    activeStep,
    setActiveStep,
    isAllStepsCompleted,
    handleBack,
    handleSave,
    handleNext,
    save,
    index,
    isFormsEdited,
    setFormEditedStatus,
    handlerPolicySave,
    lossInformation,
    catCodes,
    lossQualifiers,
    confirm,
    setConfirm,
    handleSearchNext,
    hasPolicyRef,
    policyInformation,
    setCurrentContextActive,
    currentContextActive,
    formEditedStatus,
    validation,
    setValidation,
    saveStatus,
    setSaveStatus,
    onSaveHandle,
  } = props;

  const classes = makeStyles(styles, { name: 'LinkSearchPolicyView' })();

  return (
    <>
      <div className={classes.wrapper}>
        <Layout main padding>
          <Box>
          </Box>
          <Box>
            <Grid container spacing={1}>
              <Grid item xs={12}>
                <LinkClaimSelectPolicy 
                    confirm={confirm} 
                    validation={validation} 
                    setValidation={setValidation} 
                    setConfirm={setConfirm} 
                    hasPolicyRef={hasPolicyRef} 
                    formEditedStatus={formEditedStatus} 
                    currentContextActive={currentContextActive}
                    activeStep={activeStep}
                    setActiveStep={setActiveStep}
                    isAllStepsCompleted={isAllStepsCompleted}
                    handleBack={handleBack}
                    handleSave={handleSave}
                    handleNext={handleNext}
                    save={save}
                    index={index}
                    isFormsEdited={isFormsEdited}
                    setFormEditedStatus={setFormEditedStatus}
                    handlerPolicySave={handlerPolicySave}
                    saveStatus={saveStatus}
                    setSaveStatus={setSaveStatus}
                />
              </Grid>
              {/* <Grid item xs={12}>
                {hasPolicyRef && currentContextActive && (
                  <ClaimsUploadViewSearchDocs
                    refData={{ ...policyInformation }}
                    refIdName={constants.DMS_CONTEXT_POLICY_ID}
                    dmsContext={constants.DMS_CONTEXT_POLICY}
                    viewOptions={{
                      upload: false,
                    }}
                    defaultTab={constants.DMS_VIEW_TAB_SEARCH}
                    documentTypeKey={constants.DMS_DOCUMENT_TYPE_SECTION_KEYS.type.claims}
                  />
                )}
              </Grid> */}
            </Grid>
          </Box>
        </Layout>
      </div>
      <RegisterNewLossFixedBottomBar
          activeStep={activeStep}
          isAllStepsCompleted={isAllStepsCompleted}
          handleBack={() => { handleBack(index) }}
          handleSave={onSaveHandle}
          handleNextSubmit={() => handleNext(index)}
          save={isFormsEdited[index]?.formEditedStatus}
      />
    </>
  );
}
